import React from 'react'
import gql from 'graphql-tag';


import dd from 'ss'
import { Query } from 'react-apollo';


const POSTS_QUERY = gql`
  query POSTSQuery {
    posts {
      id
      userId
      title
      body
    }
  }
`;

export default function Posts() {
  return (
    <Query query={POSTS_QUERY}>
      {
        ({ data }) => {
          return (
            <div className="my-5 text-light bd-secondary">
              {data.posts.map(post => (
                <p>post</p>
              ))}
            </div>
          )
        }
      }
    </Query>

  )
}
